import React from "react";

const Requirements = (props) => {
    const languages = props.data.languages || [];
    const tools = props.data.tools || []
  const list = [
    props.data.role,
    props.data.level,
    props.data.languages.map((x, i) => {
      return (
        <div key={i} className="eachRequirement">
          {x}
        </div>
      );
    }),
    props.data.tools.map((x, i) => {
      return (
        <div key={i} className="eachRequirement">
          {x}
        </div>
      );
    }),
  ];
  return (
    <div className="requirements">
      {list.map((x, i) => {
        return (
          <div key={i} className="eachRequirement">
            {x}
          </div>
        );
      })}
    </div>
  );
};

export default Requirements;
